import React from 'react';
import { faEnvelope, faWhatsapp, faInstagram } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import './css/Footer.css';



const Footer = () => {
    return (
        <footer className="footer">
            <a href="mailto:proveedor@example.com" className="footer-link">
                <FontAwesomeIcon icon={faEnvelope} />
            </a>
            <a href="https://wa.me/proveedor" className="footer-link">
                <FontAwesomeIcon icon={faWhatsapp} />
            </a>
            <a href="https://www.instagram.com/proveedor/" className="footer-link">
                <FontAwesomeIcon icon="fa-brands fa-instagram" />
            </a>
        </footer>
    );
};

export default Footer;
